import { useEffect, useState } from 'react';
import Scanner from '../components/QrScaner/Scanner';
import { getCycle } from '../components/lib/api';
import useHttp from '../components/hooks/use-http';
import Button from '../components/UI/Button';
const Rent = () => {
  const [data, setData] = useState(null);
  const [done, setDone] = useState(false);
  const role = '';
  const [one, setOne] = useState(false);
  const [two, setTwo] = useState(false);
  const { sendRequest, status, data: cycle, error } = useHttp(getCycle, true);

  const rentHandler = () => {
    console.log(data);
  };
  useEffect(() => {
    setOne(true);
  }, [one]);
  if (role === 'admin') {
    setOne(true);
  }
  if (role === 'guard') {
    setTwo(true);
  }

  const ScanComplete = (props) => {
    setData(props);
    setDone(true);
  };
  return (
    <div>
      {!one && !two && (
        <div>
          {!done && <Scanner scan={ScanComplete} />}
          {data && <p>{data}</p>}
          {done && <Button click={rentHandler}>Rent</Button>}
        </div>
      )}
      {!one && two && (
        <div>
          {!done && <Scanner scan={ScanComplete} />}
          {data && <p>{data}</p>}
          {done && <Button click={rentHandler}>Return</Button>}
        </div>
      )}
      {one && !two && (
        <div>
          {!done && <Scanner scan={ScanComplete} />}
          {data && <p>{data}</p>}
          {done && <Button click={rentHandler}>Admin</Button>}
        </div>
      )}
    </div>
  );
};

export default Rent;
